import React from 'react';
import Menu from '../Menu/Menu'
import menus_data from './navdata';
import 'index.scss';

export default class Index extends React.Component{
render () {
  return (
      <header className={"header"}>
        <div className="wrapper">
		  <Menu menu={menus_data} />
        </div>
        </header>
  )
}
}
